    <figure className="figure">
    <img className="" style={{width: "350px", height:"350px", borderRadius:"30px !important"}}src="https://github.com/codeforsanjose/heartofthevalley/blob/develop/app/client/src/assets/img/Hand-in-hand.jpg?raw=true" class="figure-img img-fluid rounded" alt="A generic square placeholder image with rounded corners in a figure."/>
